import './App.css';
import {Text, StyleSheet} from 'react-native';

function AuthForm() {
    return (
        <>  
        <div className="title">
            <Text style={styles.titleText}>City Jail Information Center</Text>
        </div>
        </>
    );
}

const styles = StyleSheet.create({
    titleText: {
      fontSize: 70,
      fontWeight: 'bold',
    },
  });

export default AuthForm;
